### [`v7.8.1`](https://redirect.github.com/remix-run/react-router/blob/HEAD/packages/react-router/CHANGELOG.md#781)

[Compare Source](https://redirect.github.com/remix-run/react-router/compare/react-router@7.8.0...react-router@7.8.1)

##### Patch Changes

- Fix usage of optional path segments in nested routes defined using absolute paths ([#&#8203;14135](https://redirect.github.com/remix-run/react-router/pull/14135))
- Bubble client pre-next middleware error to the shallowest ancestor that needs to load, not strictly the shallowest ancestor with a loader ([#&#8203;14150](https://redirect.github.com/remix-run/react-router/pull/14150))
- Fix optional static segment matching in `matchPath` ([#&#8203;11813](https://redirect.github.com/remix-run/react-router/pull/11813))
- Fix prerendering when a `basename` is set with `ssr:false` ([#&#8203;13791](https://redirect.github.com/remix-run/react-router/pull/13791))
- Provide `isRouteErrorResponse` utility in `react-server` environments ([#&#8203;14166](https://redirect.github.com/remix-run/react-router/pull/14166))
- Propagate non-redirect Responses thrown from middleware to the error boundary on document/data requests ([#&#8203;14182](https://redirect.github.com/remix-run/react-router/pull/14182))
- Handle `meta` and `links` Route Exports in RSC Data Mode ([#&#8203;14136](https://redirect.github.com/remix-run/react-router/pull/14136))
- Properly convert returned/thrown `data()` values to `Response` instances via `Response.json()` in resource routes and middleware ([#&#8203;14159](https://redirect.github.com/remix-run/react-router/pull/14159), [#&#8203;14181](https://redirect.github.com/remix-run/react-router/pull/14181))

### [`v7.8.0`](https://redirect.github.com/remix-run/react-router/blob/HEAD/packages/react-router/CHANGELOG.md#780)

[Compare Source](https://redirect.github.com/remix-run/react-router/compare/react-router@7.7.1...react-router@7.8.0)

##### Minor Changes

- Add `nonce` prop to `Links` & `PrefetchPageLinks` ([#&#8203;14048](https://redirect.github.com/remix-run/react-router/pull/14048))
- Add `loaderData` arguments/properties alongside existing `data` arguments/properties to provide consistency and clarity between `loaderData` and `actionData` across the board ([#&#8203;14047](https://redirect.github.com/remix-run/react-router/pull/14047))
  - Updated types: `Route.MetaArgs`, `Route.MetaMatch`, `MetaArgs`, `MetaMatch`, `Route.ComponentProps.matches`, `UIMatch`
  - `@deprecated` warnings have been added to the existing `data` properties to point users to new `loaderData` properties, in preparation for removing the `data` properties in a future major release

##### Patch Changes

- Prevent *"Did not find corresponding fetcher result"* console error when navigating during a `fetcher.submit` revalidation ([#&#8203;14114](https://redirect.github.com/remix-run/react-router/pull/14114))

- Bubble client-side middleware errors prior to `next` to the appropriate ancestor error boundary ([#&#8203;14138](https://redirect.github.com/remix-run/react-router/pull/14138))

- Switch Lazy Route Discovery manifest URL generation to usea standalone `URLSearchParams` instance instead of `URL.searchParams` to avoid a major performance bottleneck in Chrome ([#&#8203;14084](https://redirect.github.com/remix-run/react-router/pull/14084))

- Adjust internal RSC usage of `React.use` to avoid Webpack compilation errors when using React 18 ([#&#8203;14113](https://redirect.github.com/remix-run/react-router/pull/14113))

- Remove dependency on `@types/node` in TypeScript declaration files ([#&#8203;14059](https://redirect.github.com/remix-run/react-router/pull/14059))

- Fix types for `UIMatch` to reflect that the `loaderData`/`data` properties may be `undefined` ([#&#8203;12206](https://redirect.github.com/remix-run/react-router/pull/12206))

  - When an `ErrorBoundary` is being rendered, not all active matches will have loader data available, since it may have been their `loader` that threw to trigger the boundary
  - The `UIMatch.data` type was not correctly handing this and would always reflect the presence of data, leading to the unexpected runtime errors when an `ErrorBoundary` was rendered
  -  This may cause some type errors to show up in your code for unguarded `match.data` accesses - you should properly guard for `undefined` values in those scenarios.

  ```tsx
  // app/root.tsx
  export function loader() {
    someFunctionThatThrows(); //  Throws an Error
    return { title: "My Title" };
  }

  export function Layout({ children }: { children: React.ReactNode }) {
    let matches = useMatches();
    let rootMatch = matches[0] as UIMatch<Awaited<ReturnType<typeof loader>>>;
    //  ^ rootMatch.data is incorrectly typed here, so TypeScript does not
    //    complain if you do the following which throws an error at runtime:
    let { title } = rootMatch.data; // 

    return <html>...</html>;
  }
  ```

- \[UNSTABLE] Ensure resource route errors go through `handleError` w/middleware enabled ([#&#8203;14078](https://redirect.github.com/remix-run/react-router/pull/14078))

- \[UNSTABLE] Propagate returned Response from server middleware if next wasn't called ([#&#8203;14093](https://redirect.github.com/remix-run/react-router/pull/14093))

- \[UNSTABLE] Allow server middlewares to return `data()` values which will be converted into a `Response` ([#&#8203;14093](https://redirect.github.com/remix-run/react-router/pull/14093))

- \[UNSTABLE] Update middleware error handling so that the `next` function never throws and instead handles any middleware errors at the proper `ErrorBoundary` and returns the `Response` up through the ancestor `next` function ([#&#8203;14118](https://redirect.github.com/remix-run/react-router/pull/14118))

- \[UNSTABLE] When middleware is enabled, make the `context` parameter read-only (via `Readonly<unstable_RouterContextProvider>`) so that TypeScript will not allow you to write arbitrary fields to it in loaders, actions, or middleware. ([#&#8203;14097](https://redirect.github.com/remix-run/react-router/pull/14097))

- \[UNSTABLE] Rename and alter the signature/functionality of the `unstable_respond` API in `staticHandler.query`/`staticHandler.queryRoute` ([#&#8203;14103](https://redirect.github.com/remix-run/react-router/pull/14103))

  - The API has been renamed to `unstable_generateMiddlewareResponse` for clarity
  - The main functional change is that instead of running the loaders/actions before calling `unstable_respond` and handing you the result, we now pass a `query`/`queryRoute` function as a parameter and you execute the loaders/actions inside your callback, giving you full access to pre-processing and error handling
  - The `query` version of the API now has a signature of `(query: (r: Request) => Promise<StaticHandlerContext | Response>) => Promise<Response>`
  - The `queryRoute` version of the API now has a signature of `(queryRoute: (r: Request) => Promise<Response>) => Promise<Response>`
  - This allows for more advanced usages such as running logic before/after calling `query` and direct error handling of errors thrown from query
  -  This is a breaking change if you've adopted the `staticHandler` `unstable_respond` API

  ```tsx
  let response = await staticHandler.query(request, {
    requestContext: new unstable_RouterContextProvider(),
    async unstable_generateMiddlewareResponse(query) {
      try {
        // At this point we've run middleware top-down so we need to call the
        // handlers and generate the Response to bubble back up the middleware
        let result = await query(request);
        if (isResponse(result)) {
          return result; // Redirects, etc.
        }
        return await generateHtmlResponse(result);
      } catch (error: unknown) {
        return generateErrorResponse(error);
      }
    },
  });
  ```

- \[UNSTABLE] Convert internal middleware implementations to use the new `unstable_generateMiddlewareResponse` API ([#&#8203;14103](https://redirect.github.com/remix-run/react-router/pull/14103))

- \[UNSTABLE] Change `getLoadContext` signature (`type GetLoadContextFunction`) when `future.unstable_middleware` is enabled so that it returns an `unstable_RouterContextProvider` instance instead of a `Map` used to contruct the instance internally ([#&#8203;14097](https://redirect.github.com/remix-run/react-router/pull/14097))
  - This also removes the `type unstable_InitialContext` export
  -  This is a breaking change if you have adopted middleware and are using a custom server with a `getLoadContext` function

- \[UNSTABLE] Run client middleware on client navigations even if no loaders exist ([#&#8203;14106](https://redirect.github.com/remix-run/react-router/pull/14106))

- \[UNSTABLE] Change the `unstable_getContext` signature on `RouterProvider`/`HydratedRouter`/`unstable_RSCHydratedRouter` so that it returns an `unstable_RouterContextProvider` instance instead of a `Map` used to contruct the instance internally ([#&#8203;14097](https://redirect.github.com/remix-run/react-router/pull/14097))
  -  This is a breaking change if you have adopted the `unstable_getContext` prop

- \[UNSTABLE] proxy server action side-effect redirects from actions for document and callServer requests ([#&#8203;14131](https://redirect.github.com/remix-run/react-router/pull/14131))

- \[UNSTABLE] Fix RSC Data Mode issue where routes that return `false` from `shouldRevalidate` would be replaced by an `<Outlet />` ([#&#8203;14071](https://redirect.github.com/remix-run/react-router/pull/14071))

### [`v7.7.1`](https://redirect.github.com/remix-run/react-router/blob/HEAD/packages/react-router/CHANGELOG.md#771)

[Compare Source](https://redirect.github.com/remix-run/react-router/compare/react-router@7.7.0...react-router@7.7.1)

##### Patch Changes

- In RSC Data Mode, fix bug where routes with errors weren't forced to revalidate when `shouldRevalidate` returned false ([#&#8203;14026](https://redirect.github.com/remix-run/react-router/pull/14026))
- In RSC Data Mode, fix `Matched leaf route at location "/..." does not have an element or Component` warnings when error boundaries are rendered. ([#&#8203;14021](https://redirect.github.com/remix-run/react-router/pull/14021))

### [`v7.7.0`](https://redirect.github.com/remix-run/react-router/blob/HEAD/packages/react-router/CHANGELOG.md#770)

[Compare Source](https://redirect.github.com/remix-run/react-router/compare/react-router@7.6.3...react-router@7.7.0)

##### Minor Changes

- Add unstable RSC support ([#&#8203;13700](https://redirect.github.com/remix-run/react-router/pull/13700))

  For more information, see the [RSC documentation](https://reactrouter.com/start/rsc/installation).

##### Patch Changes

- Handle `InvalidCharacterError` when validating cookie signature ([#&#8203;13847](https://redirect.github.com/remix-run/react-router/pull/13847))

- Pass a copy of `searchParams` to the `setSearchParams` callback function to avoid muations of the internal `searchParams` instance. This was an issue when navigations were blocked because the internal instance be out of sync with `useLocation().search`. ([#&#8203;12784](https://redirect.github.com/remix-run/react-router/pull/12784))

- Support invalid `Date` in `turbo-stream` v2 fork ([#&#8203;13684](https://redirect.github.com/remix-run/react-router/pull/13684))

- In Framework Mode, clear critical CSS in development after initial render ([#&#8203;13872](https://redirect.github.com/remix-run/react-router/pull/13872))

- Strip search parameters from `patchRoutesOnNavigation` `path` param for fetcher calls ([#&#8203;13911](https://redirect.github.com/remix-run/react-router/pull/13911))

- Skip scroll restoration on useRevalidator() calls because they're not new locations ([#&#8203;13671](https://redirect.github.com/remix-run/react-router/pull/13671))

- Support unencoded UTF-8 routes in prerender config with `ssr` set to `false` ([#&#8203;13699](https://redirect.github.com/remix-run/react-router/pull/13699))

- Do not throw if the url hash is not a valid URI component ([#&#8203;13247](https://redirect.github.com/remix-run/react-router/pull/13247))

- Fix a regression in `createRoutesStub` introduced with the middleware feature. ([#&#8203;13946](https://redirect.github.com/remix-run/react-router/pull/13946))

  As part of that work we altered the signature to align with the new middleware APIs without making it backwards compatible with the prior `AppLoadContext` API. This permitted `createRoutesStub` to work if you were opting into middleware and the updated `context` typings, but broke `createRoutesStub` for users not yet opting into middleware.

  We've reverted this change and re-implemented it in such a way that both sets of users can leverage it.

  ```tsx
  // If you have not opted into middleware, the old API should work again
  let context: AppLoadContext = {
    /*...*/
  };
  let Stub = createRoutesStub(routes, context);

  // If you have opted into middleware, you should now pass an instantiated `unstable_routerContextProvider` instead of a `getContext` factory function.
  let context = new unstable_RouterContextProvider();
  context.set(SomeContext, someValue);
  let Stub = createRoutesStub(routes, context);
  ```

   This may be a breaking bug for if you have adopted the unstable Middleware feature and are using `createRoutesStub` with the updated API.

- Remove `Content-Length` header from Single Fetch responses ([#&#8203;13902](https://redirect.github.com/remix-run/react-router/pull/13902))

### [`v7.6.3`](https://redirect.github.com/remix-run/react-router/blob/HEAD/packages/react-router/CHANGELOG.md#763)

[Compare Source](https://redirect.github.com/remix-run/react-router/compare/react-router@7.6.2...react-router@7.6.3)

##### Patch Changes

- Do not serialize types for `useRouteLoaderData<typeof clientLoader>` ([#&#8203;13752](https://redirect.github.com/remix-run/react-router/pull/13752))

  For types to distinguish a `clientLoader` from a `serverLoader`, you MUST annotate `clientLoader` args:

  ```ts
  //                                    annotation required to skip serializing types
  export function clientLoader({}: Route.ClientLoaderArgs) {
    return { fn: () => "earth" };
  }

  function SomeComponent() {
    const data = useRouteLoaderData<typeof clientLoader>("routes/this-route");
    const planet = data?.fn() ?? "world";
    return <h1>Hello, {planet}!</h1>;
  }
  ```

### [`v7.6.2`](https://redirect.github.com/remix-run/react-router/blob/HEAD/packages/react-router/CHANGELOG.md#762)

[Compare Source](https://redirect.github.com/remix-run/react-router/compare/react-router@7.6.1...react-router@7.6.2)

##### Patch Changes

- Avoid additional `with-props` chunk in Framework Mode by moving route module component prop logic from the Vite plugin to `react-router` ([#&#8203;13650](https://redirect.github.com/remix-run/react-router/pull/13650))
- Slight refactor of internal `headers()` function processing for use with RSC ([#&#8203;13639](https://redirect.github.com/remix-run/react-router/pull/13639))

### [`v7.6.1`](https://redirect.github.com/remix-run/react-router/blob/HEAD/packages/react-router/CHANGELOG.md#761)

[Compare Source](https://redirect.github.com/remix-run/react-router/compare/react-router@7.6.0...react-router@7.6.1)

##### Patch Changes

- Update `Route.MetaArgs` to reflect that `data` can be potentially `undefined` ([#&#8203;13563](https://redirect.github.com/remix-run/react-router/pull/13563))

  This is primarily for cases where a route `loader` threw an error to it's own `ErrorBoundary`. but it also arises in the case of a 404 which renders the root `ErrorBoundary`/`meta` but the root loader did not run because not routes matched.

- Partially revert optimization added in `7.1.4` to reduce calls to `matchRoutes` because it surfaced other issues ([#&#8203;13562](https://redirect.github.com/remix-run/react-router/pull/13562))

- Fix typegen when same route is used at multiple paths ([#&#8203;13574](https://redirect.github.com/remix-run/react-router/pull/13574))

  For example, `routes/route.tsx` is used at 4 different paths here:

  ```ts
  import { type RouteConfig, route } from "@&#8203;react-router/dev/routes";
  export default [
    route("base/:base", "routes/base.tsx", [
      route("home/:home", "routes/route.tsx", { id: "home" }),
      route("changelog/:changelog", "routes/route.tsx", { id: "changelog" }),
      route("splat/*", "routes/route.tsx", { id: "splat" }),
    ]),
    route("other/:other", "routes/route.tsx", { id: "other" }),
  ] satisfies RouteConfig;
  ```

  Previously, typegen would arbitrarily pick one of these paths to be the "winner" and generate types for the route module based on that path.
  Now, typegen creates unions as necessary for alternate paths for the same route file.

- Better types for `params` ([#&#8203;13543](https://redirect.github.com/remix-run/react-router/pull/13543))

  For example:

  ```ts
  // routes.ts
  import { type RouteConfig, route } from "@&#8203;react-router/dev/routes";

  export default [
    route("parent/:p", "routes/parent.tsx", [
      route("layout/:l", "routes/layout.tsx", [
        route("child1/:c1a/:c1b", "routes/child1.tsx"),
        route("child2/:c2a/:c2b", "routes/child2.tsx"),
      ]),
    ]),
  ] satisfies RouteConfig;
  ```

  Previously, `params` for the `routes/layout.tsx` route were calculated as `{ p: string, l: string }`.
  This incorrectly ignores params that could come from child routes.
  If visiting `/parent/1/layout/2/child1/3/4`, the actual params passed to `routes/layout.tsx` will have a type of `{ p: string, l: string, c1a: string, c1b: string }`.

  Now, `params` are aware of child routes and autocompletion will include child params as optionals:

  ```ts
  params.|
  //     ^ cursor is here and you ask for autocompletion
  // p: string
  // l: string
  // c1a?: string
  // c1b?: string
  // c2a?: string
  // c2b?: string
  ```

  You can also narrow the types for `params` as it is implemented as a normalized union of params for each page that includes `routes/layout.tsx`:

  ```ts
  if (typeof params.c1a === 'string') {
    params.|
    //     ^ cursor is here and you ask for autocompletion
    // p: string
    // l: string
    // c1a: string
    // c1b: string
  }
  ```

  ***

  UNSTABLE: renamed internal `react-router/route-module` export to `react-router/internal`
  UNSTABLE: removed `Info` export from generated `+types/*` files

- Avoid initial fetcher execution 404 error when Lazy Route Discovery is interrupted by a navigation ([#&#8203;13564](https://redirect.github.com/remix-run/react-router/pull/13564))

- href replaces splats `*` ([#&#8203;13593](https://redirect.github.com/remix-run/react-router/pull/13593))

  ```ts
  const a = href("/products/*", { "*": "/1/edit" });
  // -> /products/1/edit
  ```

### [`v7.6.0`](https://redirect.github.com/remix-run/react-router/blob/HEAD/packages/react-router/CHANGELOG.md#760)

[Compare Source](https://redirect.github.com/remix-run/react-router/compare/react-router@7.5.3...react-router@7.6.0)

##### Minor Changes

- Added a new `react-router.config.ts` `routeDiscovery` option to configure Lazy Route Discovery behavior. ([#&#8203;13451](https://redirect.github.com/remix-run/react-router/pull/13451))
  - By default, Lazy Route Discovery is enabled and makes manifest requests to the `/__manifest` path:
    - `routeDiscovery: { mode: "lazy", manifestPath: "/__manifest" }`
  - You can modify the manifest path used:
    - `routeDiscovery: { mode: "lazy", manifestPath: "/custom-manifest" }`
  - Or you can disable this feature entirely and include all routes in the manifest on initial document load:
    - `routeDiscovery: { mode: "initial" }`

- Add support for route component props in `createRoutesStub`. This allows you to unit test your route components using the props instead of the hooks: ([#&#8203;13528](https://redirect.github.com/remix-run/react-router/pull/13528))

  ```tsx
  let RoutesStub = createRoutesStub([
    {
      path: "/",
      Component({ loaderData }) {
        let data = loaderData as { message: string };
        return <pre data-testid="data">Message: {data.message}</pre>;
      },
      loader() {
        return { message: "hello" };
      },
    },
  ]);

  render(<RoutesStub />);

  await waitFor(() => screen.findByText("Message: hello"));
  ```

##### Patch Changes

- Fix `react-router` module augmentation for `NodeNext` ([#&#8203;13498](https://redirect.github.com/remix-run/react-router/pull/13498))

- Don't bundle `react-router` in `react-router/dom` CJS export ([#&#8203;13497](https://redirect.github.com/remix-run/react-router/pull/13497))

- Fix bug where a submitting `fetcher` would get stuck in a `loading` state if a revalidating `loader` redirected ([#&#8203;12873](https://redirect.github.com/remix-run/react-router/pull/12873))

- Fix hydration error if a server `loader` returned `undefined` ([#&#8203;13496](https://redirect.github.com/remix-run/react-router/pull/13496))

- Fix initial load 404 scenarios in data mode ([#&#8203;13500](https://redirect.github.com/remix-run/react-router/pull/13500))

- Stabilize `useRevalidator`'s `revalidate` function ([#&#8203;13542](https://redirect.github.com/remix-run/react-router/pull/13542))

- Preserve status code if a `clientAction` throws a `data()` result in framework mode ([#&#8203;13522](https://redirect.github.com/remix-run/react-router/pull/13522))

- Be defensive against leading double slashes in paths to avoid `Invalid URL` errors from the URL constructor ([#&#8203;13510](https://redirect.github.com/remix-run/react-router/pull/13510))
  - Note we do not sanitize/normalize these paths - we only detect them so we can avoid the error that would be thrown by `new URL("//", window.location.origin)`

- Remove `Navigator` declaration for `navigator.connection.saveData` to avoid messing with any other types beyond `saveData` in userland ([#&#8203;13512](https://redirect.github.com/remix-run/react-router/pull/13512))

- Fix `handleError` `params` values on `.data` requests for routes with a dynamic param as the last URL segment ([#&#8203;13481](https://redirect.github.com/remix-run/react-router/pull/13481))

- Don't trigger an `ErrorBoundary` UI before the reload when we detect a manifest verison mismatch in Lazy Route Discovery ([#&#8203;13480](https://redirect.github.com/remix-run/react-router/pull/13480))

- Inline `turbo-stream@2.4.1` dependency and fix decoding ordering of Map/Set instances ([#&#8203;13518](https://redirect.github.com/remix-run/react-router/pull/13518))

- Only render dev warnings in DEV mode ([#&#8203;13461](https://redirect.github.com/remix-run/react-router/pull/13461))

- UNSTABLE: Fix a few bugs with error bubbling in middleware use-cases ([#&#8203;13538](https://redirect.github.com/remix-run/react-router/pull/13538))

- Short circuit post-processing on aborted `dataStrategy` requests ([#&#8203;13521](https://redirect.github.com/remix-run/react-router/pull/13521))
  - This resolves non-user-facing console errors of the form `Cannot read properties of undefined (reading 'result')`

### [`v7.5.3`](https://redirect.github.com/remix-run/react-router/blob/HEAD/packages/react-router/CHANGELOG.md#753)

[Compare Source](https://redirect.github.com/remix-run/react-router/compare/react-router@7.5.2...react-router@7.5.3)

##### Patch Changes

- Fix bug where bubbled action errors would result in `loaderData` being cleared at the handling `ErrorBoundary` route ([#&#8203;13476](https://redirect.github.com/remix-run/react-router/pull/13476))
- Handle redirects from `clientLoader.hydrate` initial load executions ([#&#8203;13477](https://redirect.github.com/remix-run/react-router/pull/13477))

### [`v7.5.2`](https://redirect.github.com/remix-run/react-router/blob/HEAD/packages/react-router/CHANGELOG.md#752)

[Compare Source](https://redirect.github.com/remix-run/react-router/compare/react-router@7.5.1...react-router@7.5.2)

##### Patch Changes

- Update Single Fetch to also handle the 204 redirects used in `?_data` requests in Remix v2 ([#&#8203;13364](https://redirect.github.com/remix-run/react-router/pull/13364))
  - This allows applications to return a redirect on `.data` requests from outside the scope of React Router (i.e., an `express`/`hono` middleware)
  -  Please note that doing so relies on implementation details that are subject to change without a SemVer major release
  - This is primarily done to ease upgrading to Single Fetch for existing Remix v2 applications, but the recommended way to handle this is redirecting from a route middleware

